/*
 * Table accessor.
 */
idn__bidiclass_t
idn__sparsemap_getbidiclass(unsigned long v) {
	int idx0, idx1, idx2;

	if (v > UTF32_MAX)
		return (idn__bidiclass_unknown);
	idx0 = v >> (BIDICLASS_BITS_1 + BIDICLASS_BITS_2);
	idx1 = (v >> BIDICLASS_BITS_2) & ((1 << BIDICLASS_BITS_1) - 1);
	idx2 = v & ((1 << BIDICLASS_BITS_2) - 1);
	return (idn__bidiclass_t) bidiclass_table[bidiclass_imap[bidiclass_imap[idx0] + idx1]].tbl[idx2];
}
